const swiper=new Swiper(".swiper-container",{slidesPerView:3,spaceBetween:32,navigation:{nextEl:".swiper-button-next",prevEl:".swiper-button-prev"},pagination:{el:".swiper-pagination",clickable:!0},breakpoints:{767:{centeredSlides:!0,slidesPerView:1,spaceBetween:10},768:{slidesPerView:2,spaceBetween:20}}});function toggleAnswer(e){document.getElementById("answer"+e).classList.toggle("active");document.getElementById("svg"+e).classList.toggle("active")}